import * as React from 'react';
import Grid from '@mui/material/Grid';
//import Item  from '@mui/material/Grid';

//import Item from '@mui/material/Item';

function Userscreen() {
  return (
    <Grid container spacing={2}>
      <Grid item xs={12} md={6}>
        <div style={{ background: 'red', height: '100%', width: '100%' }}>Column 1, Row 1</div>
      </Grid>
      <Grid item xs={12} md={6}>
        <div style={{ background: 'blue', height: '100%', width: '100%' }}>Column 2, Row 1</div>
      </Grid>
      <Grid item xs={12} md={6}>
        <div style={{ background: 'green', height: '100%', width: '100%' }}>Column 1, Row 2</div>
      </Grid>
      <Grid item xs={12} md={6}>
        <div style={{ background: 'yellow', height: '100%', width: '100%' }}>Column 2, Row 2</div>
      </Grid>
    </Grid>
  );
}


  export default Userscreen;
